import './App.css';
import { BrowserRouter as Router,Route,Switch,Link } from 'react-router-dom';
import Homepage from './Homepage.js';
import Contact from './Contact'


function App() {
  return (
  <Router>
    <Switch>
      <Route exact path='/' component={Homepage} />
      <Route exact path='/' component={Contact} />
    </Switch>
  </Router>
  );
}

export default App;
